import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import True from "../../../../images/icons-check-green-copy-9.png";
import False from "../../../../images/icons-check-reed-copy.png";

const useStyles = makeStyles({
    table: {
        width: '50%',
        margin:'auto',
      },
      TableRow:{
          borderRight:"1px solid #f0f0f6",
          borderLeft:"1px solid #f0f0f6",
      },
  });
  function createData(Title,Cost,Sep,Oct, Dec ,Jan,Feb,Mar,Apr,May) {
    return { Title,Cost,Sep,Oct, Dec ,Jan,Feb,Mar,Apr,May };
  }
  
  const rows = [
    createData('School Fees',True,True,false,null,null,null,null,null),
    createData('Insurance Fees',True,True,false,null,null,null,null,null),
    createData('Transport Fees',True,True,false,null,null,null,null,null),
    
  ];
export default function Finance() {
    const classes = useStyles();

    return (
        <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="simple table">
                <TableHead >
                    <TableRow className={classes.TableRow}>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Expenses</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Sep</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Oct</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Dec</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Jan</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Feb</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Mar</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>Apr</TableCell>
                        <TableCell style={{color:"rgba(21, 26, 59, 0.5)"}}>May</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                {rows.map((row) => (
                    <TableRow key={row.Title} className={classes.TableRow}>
                        <TableCell component="th" scope="row">
                            <div className={classes.Abrv} style={{backgroundColor:row.BgColor}}>
                                {row.Abrv}
                            </div>
                            <div className={classes.TS}>
                                <span>{row.Title}</span>
                                <div className={classes.Subject}>{row.Subject}</div>
                            </div>
                        </TableCell>
                        <TableCell align="right">{row.Date}</TableCell>
                    </TableRow> 
                ))}
                </TableBody>
            </Table>
        </TableContainer>
    )
}
